import React, { useState } from 'react';
import email from "./Components/email.png";
import pass from "./Components/password.png";
import './login.css'; // optional if you have styles

const Login = () => {
  const [action, setAction] = useState("Login");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");

  const handlePasswordChange = (e) => {
    const value = e.target.value;
    setPassword(value);

    if (value.length < 8 || value.length > 16) {
      setError("Password must be 8 to 16 characters");
    } else {
      setError(""); // clear error when valid
    }
  };

  return (
    <div className="container">
      <div className="header">
        <div className="text">{action}</div>
        <div className="underline"></div>
      </div>

      <div className="inputs">
        {action === "Login" ? (
          <>
            <div className="input">
              <img src={email} alt="email icon" />
              <input type="email" placeholder="Email ID" />
            </div>

            <div className="input" style={{ flexDirection: "column" }}>
              <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
                <img src={pass} alt="password icon" />
                <input
                  type="password"
                  placeholder="Password"
                  value={password}
                  onChange={handlePasswordChange}
                  style={{ flex: 1, padding: "8px", fontSize: "14px" }}
                />
              </div>
              {error && (
                <span style={{ color: "red", fontSize: "12px", marginTop: "4px" }}>
                  {error}
                </span>
              )}
            </div>
          </>
        ) : (
          <>
            <div className="input">
              <input type="text" placeholder="First Name" />
            </div>
            <div className="input">
              <input type="text" placeholder="Last Name" />
            </div>
            <div className="input">
              <label htmlFor="birthday">Birthday:</label>
              <input type="date" id="birthday" name="birthday" />
            </div>
            <div className="input">
              <label>Gender:</label>
              <input type="radio" id="male" name="gender" value="male" />
              <label htmlFor="male">Male</label>
              <input type="radio" id="female" name="gender" value="female" />
              <label htmlFor="female">Female</label>
            </div>
          </>
        )}
      </div>

      {action === "Sign up" ? (
        <div></div>
      ) : (
        <div className="forgetpass">
          Forgot Password? <span>Click here!</span>
        </div>
      )}

      <div className="submit-container">
        <div
          className={action === "Login" ? "submit gray" : "submit"}
          onClick={() => setAction("Sign up")}
        >
          Sign up
        </div>
        <div
          className={action === "Sign up" ? "submit gray" : "submit"}
          onClick={() => setAction("Login")}
        >
          Login
        </div>
      </div>
    </div>
  );
};

export default Login;
